import { useEffect, useState } from 'react';
import axios from 'axios';  // If using axios directly for API requests

// Usage
const API_URL = 'http://localhost:5000/api/cars';

function CarList() {
    const [cars, setCars] = useState([]);
    const [search, setSearch] = useState('');

    useEffect(() => {
        async function fetchCars() {
            try {
                const result = await axios.get(`${API_URL}/my-cars`);
                setCars(result.data);
            } catch (error) {
                console.error('Error fetching cars:', error);
            }
        }
        fetchCars();
    }, []);

    const filteredCars = cars.filter((car) =>
        car.title.toLowerCase().includes(search.toLowerCase()) ||
        car.description.toLowerCase().includes(search.toLowerCase()) ||
        car.tags.some((tag) => tag.toLowerCase().includes(search.toLowerCase()))
    );

    return (
        <div>
            <input
                type="text"
                placeholder="Search Cars..."
                value={search}
                onChange={(e) => setSearch(e.target.value)}
            />
            <div>
                {filteredCars.map((car) => (
                    <div key={car._id}>
                        <h3>{car.title}</h3>
                        <p>{car.description}</p>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default CarList;
